def overlap_graph(patterns):
    # Initialize an empty adjacency list
    graph = {}

    # Iterate through each pattern in the collection
    for i, pattern1 in enumerate(patterns):
        # Create an empty list for the current pattern's neighbors
        graph[pattern1] = []

        # Iterate through the remaining patterns
        for j, pattern2 in enumerate(patterns):
            # Skip comparing a pattern to itself
            if i != j:
                # Check if there is an overlap between the suffix of pattern1 and the prefix of pattern2
                if pattern1[1:] == pattern2[:-1]:
                    # Add an edge from pattern1 to pattern2
                    graph[pattern1].append(pattern2)

    return graph

